{
  "message_name": "UBX-MGA-INI-FREQ",
  "class_id": "0x13",
  "message_id": "0x40",
  "message_type": "input",
  "description": "Initial frequency assistance. This message allows the delivery of external frequency assistance to a receiver. See section AssistNow online in the integration manual for details.",
  "payload_length": {
    "fixed": 12
  },
  "payload_fields": [
    {
      "byte_offset": 0,
      "name": "type",
      "data_type": "U1",
      "description": "Message type (0x21 for this type)",
      "fixed_value": 33
    },
    {
      "byte_offset": 1,
      "name": "version",
      "data_type": "U1",
      "description": "Message version (0x00 for this version)",
      "fixed_value": 0
    },
    {
      "byte_offset": 2,
      "name": "reserved0",
      "data_type": "U1",
      "reserved": true
    },
    {
      "byte_offset": 3,
      "name": "flags",
      "data_type": "X1",
      "description": "Frequency reference",
      "bitfield_fields": [
        {
          "name": "source",
          "position": 0,
          "length": 4,
          "description": "Frequency reference. Currently supported: 0 = frequency available on EXTINT0; 1 = frequency available on EXTINT1; 2-15 = reserved",
          "values": [
            {
              "value": 0,
              "description": "frequency available on EXTINT0"
            },
            {
              "value": 1,
              "description": "frequency available on EXTINT1"
            },
            {
              "value": "2-15",
              "description": "reserved"
            }
          ]
        },
        {
          "name": "fall",
          "position": 4,
          "length": 1,
          "description": "use falling edge of EXTINT pulse (default rising)"
        }
      ]
    },
    {
      "byte_offset": 4,
      "name": "freq",
      "data_type": "I4",
      "scale": {
        "raw_string": "1e-2",
        "multiplier": 0.01
      },
      "unit": "Hz",
      "description": "Frequency"
    },
    {
      "byte_offset": 8,
      "name": "freqAcc",
      "data_type": "U4",
      "unit": "ppb",
      "description": "Frequency accuracy"
    }
  ]
}
